import React, { Component } from 'react';
import {  Button, Modal, ModalBody, ModalHeader, ModalFooter } from 'mdbreact';

class Nfl extends Component {
  state = {
    modal: true
  };
  toggleNfl = () => {
    this.setState({
      modal: !this.state.modal
    });
  }
  render() {

    return (

        <Modal isOpen={this.state.modal} toggle={this.toggleNfl} size="fluid" frame position="bottom">
          <ModalHeader toggle={this.toggle}>Modal title</ModalHeader>
          <ModalBody>
            This is for NFL
          </ModalBody>
          <ModalFooter>
            <Button color="secondary" onClick={this.toggleNfl}>Close</Button>
          </ModalFooter>
        </Modal>

    );
  }
}
export default Nfl;
